import React from "react";
import LoginForm from "../components/LoginForm";

export default function LoginPage({ onLogin }) {
  return (
    <div style={{ maxWidth: "400px", margin: "20px auto" }}>
      <h2>Login</h2>
      <LoginForm onLogin={onLogin} />
    </div>
  );
}
